import './about.scss';

const About = () => {
    return (
        <div className="about">
            <section>
                <div className='profile'>
                    <img id='icon1' src={require('../../assets/about/profile1.png')} />
                    {/* <img id='icon2' src={require('../../assets/about/profile2.png')} /> */}
                </div>
                <p className="intro">
                    Hello! I'm Soomin, a designer and a senior student studying in the School of Art Institute of Chicago. I'm currently finding an internship opportunity.
                    <br/><br/>
                    In my free time, I enjoy, and brewing coffee.
                </p>
            </section>

            <section>
                <h2>Contact Me</h2>
            </section>

            <section>
                <h2>More about me...</h2>

            </section>
        </div>
    );
};

export default About;
